import React from "react";
import { Link } from "react-router-dom";
import { auth } from "../utils/auth";

function Register() {

  const [userData, setUserData] = React.useState({
      email: '',
      password: ''
  })

  function handleEmail(e){
      setUserData({
          [e.target.name]: e.target.value
      })
      console.log(userData);
  }
//   function handleChange(e) {
//     const {name, value} = e.target;
//     setUserData({
//       [name]: value
//     });
//     console.log(userData);
//   }

  function handleSubmit(e) {
    e.preventDefault();
    // auth.register(email, password);
    console.log(userData);
  }

  return (
    <div className="entrance-page">
      <p className="entrance-page__title">Регистрация</p>
      <form onSubmit={handleSubmit} className="entrance-page__form" name="register">
        <input
          className="entrance-page__change-line"
          id="email"
          type="email"
          name="email"
          placeholder="Email"
          value={userData.email}
          onChange={handleEmail}
        ></input>
        <input
          className="entrance-page__change-line"
          id="password"
          type="password"
          name="password"
          placeholder="Пароль"
          value={userData.password}
        //   onChange={handleChange}
        ></input>
        <button className="entrance-page__button opacity-button">
          Зарегистрироваться
        </button>
      </form>
      <p className="entrance-page__text">
        Уже зарегистрированы?{" "}
        <Link className="entrance-page__text opacity-button" to="/sign-in">
          Войти
        </Link>
      </p>
    </div>
  );
}

export default Register;
